import "./VideoPage.css";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import ThinFooter from "../Footer/ThinFooter";
import ContentWrapper from "../Atomics/ContentWrapper/ContentWrapper";

import VideoCardList from "./VideoCardList";
import SingleVideoRight from "./SingleVideoRight";
import SingleVideoLeft from "./SingleVideoLeft";

const VideoPage = () => {
	return (
		<>
			<ContentWrapper>
				<Container fluid>
					<div className="video-block-right-list section-padding"  >
						<Row className="mb-4 fixed"   >
							<Col md={8} className='smFixedVideo'   >
								<div className="single-video"  >
									
									
								
								
									   <iframe width="100%" height="315px" 
									   src="https://www.youtube.com/embed/oEcRj5F8MbM"
									    title="YouTube video player" 
										frameborder="0"
										 allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
										  allowfullscreen
										  
										  >

										  </iframe>
								</div>
							</Col>

							<Col md={4}   >
								<div className="video-slider-right-list">
								<SingleVideoRight />
								</div>
							</Col>
						</Row>
					</div>

					<div className="video-block section-padding sm-position"   >
						<Row>
							<Col md={8} className='tagItem' >
						 
								<SingleVideoLeft />
								 
							</Col>

							<Col md={4}>
								<SingleVideoRight />
							</Col>
						</Row>
					</div>
				</Container>
				<ThinFooter />
			</ContentWrapper>
		</>
	);
};

export default VideoPage;
